import { useEffect, useState } from 'react'

function Events() {
  const [events, setEvents] = useState([])
  useEffect(() => {
    const getEventsData = async () => {
      const data = await getEventsData()
      setEvents(data)
    }
    getEventsData()
  })

  return <h1 className="m-12 text-6xl font-bold">Events</h1>
}

export default Events
